  styleUrls: ['./active.component.css']
})
export class ActiveComponent {
  accounts: { name: string, status: string }[] = [];

  constructor(private accSer: AccountService) { }


  ngOnInit(): void {
    this.accounts = this.accSer.accounts;
  }
}
